%%  Robot ABB 1100 4 58
%   Simulación 4: Solución del Robot para una Trayectoria Definida por un
%   Perfil Quintico

% Inicialización de Simulación
clc; close all; clear all; 

% Definición de variables 
global xe ye ze alpha beta gamma

% Definición de Parámetros
ABB1100_Parametros;

%% Perfíl Quíntico

% Tiempo final de la trayetoria
Intervalo = 0.1;
TiempoFinal = 10; 

% Avance de Arreglo
c = 1;

% Propuesta de Trayectoria _____________________________________________________________________________________________________________________________

% Posiciones iniciales y finales en X,Y,Z de Posicion Inicial y Final

PosInicial  = [0.25;0.0;0.4];
PosFinal    = [0.4;0.0;0.4];

%Orientaciones iniciales y finales _____________________________________________________________________________________________________________________

OrientInicial   = [deg2rad(0);deg2rad(0);deg2rad(0)];
OrientFinal     = [deg2rad(0);deg2rad(0);deg2rad(0)];

% Cálculo del Perfil Quintico __________________________________________________________________________________________________________________________


% Cálculo de Posición en el Tiempo______________________________________________________________________________________________________________________
for t = 0:Intervalo:TiempoFinal
    
   % Almacenamiento de Vector de tiempo
   Tiempo(c)= t;
   
   Rt = PosInicial+(10*(t/TiempoFinal)^3-15*(t/TiempoFinal)^4+6*(t/TiempoFinal)^5)*(PosFinal-PosInicial);
   
   % Almacenamiento de Posición en el Tiempo 
   x(c)=Rt(1);
   y(c)=Rt(2);
   z(c)=Rt(3);
   
   % Incremento de Ciclo
   c = c+1;
end

% Reinicialización de Ciclo
c = 1;

% Cálculo de Orientación en el Tiempo ____________________________________________________________________________________________________________________

for t = 0:Intervalo:TiempoFinal
   Rt = OrientInicial+(10*(t/TiempoFinal)^3-15*(t/TiempoFinal)^4+6*(t/TiempoFinal)^5)*(OrientFinal-OrientInicial);
   
   % Almacenamiento de Orientaciones en el Tiempo
   a1(c) = Rt(1);
   a2(c) = Rt(2);
   a3(c) = Rt(3);
   
   % Incremento de Ciclo
   c = c+1;

end

% Reinicialización de Ciclo
c = 1;

% Cálculo de Velocidad Cartesiana en el Tiempo __________________________________________________________________________________________________________

for t = 0:Intervalo:TiempoFinal
    
   % Almacenamiento de Vector de tiempo
   Tiempo(c)=t;
   
   Vt=(30*(t^2/TiempoFinal^3)-60*(t^3/TiempoFinal^4)+30*(t^4/TiempoFinal^5))*(PosFinal-PosInicial);
   
   % Almacenamiento de Velocidades en el Tiempo
   xv(c) = Vt(1);
   yv(c) = Vt(2);
   zv(c) = Vt(3);
   
   % Incremento de Ciclo
   c = c+1;
end

% Reinicialización de Ciclo
c = 1;

% Cálculo de Velocidades Angulares en el Tiempo __________________________________________________________________________________________________________

for t = 0:Intervalo:TiempoFinal
    
   Vt=(30*(t^2/TiempoFinal^3)-60*(t^3/TiempoFinal^4)+30*(t^4/TiempoFinal^5))*(OrientFinal-OrientInicial);
   
   % Almacenamiento de Velocidad Angular en el Tiempo
   a1p(c)=Vt(1);
   a2p(c)=Vt(2);
   a3p(c)=Vt(3);
   
   % Incremento de Ciclo
   c = c+1;
end
% Reinicialización de Ciclo
c = 1;

% Cálculo de la Aceleración Cartesiana en el Tiempo _____________________________________________________________________________________________________

for t=0:Intervalo:TiempoFinal
    
   % Almacenamiento de Vector de tiempo
   Tiempo(c)=t;
   
   At=(60*(t/TiempoFinal^3)-180*(t^2/TiempoFinal^4)+120*(t^3/TiempoFinal^5))*(PosFinal-PosInicial);
   
   % Almacenamiento de la Aceleración en el Tiempo
   xa(c) = At(1);
   ya(c) = At(2);
   za(c) = At(3);
   
   % Incremento de Ciclo
   c = c+1;
end
% Reinicialización de Ciclo
c = 1;

% Cálculo de Aceleraciones Angulares en el Tiempo _______________________________________________________________________________________________________
for t=0:Intervalo:TiempoFinal
    
   At=(60*(t/TiempoFinal^3)-180*(t^2/TiempoFinal^4)+120*(t^3/TiempoFinal^5))*(OrientFinal-OrientInicial);
   
   % Almacenamiento de Aceleraciones Angulares en el Tiempo
   a1pp(c) = At(1);
   a2pp(c) = At(2);
   a3pp(c) = At(3);
   
   % Incremento de Ciclo
   c = c+1;
end


%% Simulación Completa _____________________________________________________________________________________________________________________________

figure(1)
simulacion4 = figure(1);
simulacion4.Position(1:4) = [0 720 1440 720]
simulacion4.Name = "Simulación de Trayectoria Perfil Quintico Robot ABB 1100 4 58"

% Condiciones Iniciales de Articulaciones
q0 = [0,0,0,0,0,0];

% Reinicialización de Iterador de Avance
c = 1;

% Número de puntos que da el perfil quíntico. x,y,z -> 101 

for i = 1:1:length(x)
   
    % Almacenamiento de Soluciones De Posición del Perfíl Quíntico
    xe = x(i)
    ye = y(i)
    ze = z(i)
  
    clf
    opts = optimoptions(@fsolve,'Algorithm', 'levenberg-marquardt');
    q = fsolve(@ABB1100_CinematicaInversa,q0,opts);
    
    q1(c) = q(1);
    q2(c) = q(2);
    q3(c) = q(3);
    q4(c) = q(4);
    q5(c) = q(5);
    q6(c) = q(6);
    
    % Cálculo del Determinante
    
    DET(c) = -(l2*l3*cos(q(3))*sin(q(5))*(cos(pi) - 1)^2*(l3*cos(q(2) + q(3)) + 2*l2*cos(pi/2 + q(2)) - l3*cos(pi + q(2) + q(3))))/8;
    
    % Cálculo de la velocidad articular 
    xp = [xv(i); yv(i); zv(i); a1p(i); a2p(i);a3p(i)];
    xpp = [xa(i); ya(i);za(i); a1pp(1);a2pp(i);a3pp(i)];
    %----------------------------------------------------------------------
    J77i = [                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                    